signature.instructions:
Generate concise entity summaries from journal entries.

Accepts a JSON context dict matching graphiti-core's extract_summary prompt:
    {
        "node": {
            "name": ...,
            "summary": "<existing summary (<=250 chars)>",
            "entity_types": [...],
            "attributes": {...}
        },
        "episode_content": "...",
        "previous_episodes": ["...", "..."]
    }
